    `review_date` VARCHAR(23),
    `shown_status` INT(1) NOT NULL default 0,
    `shown_date` VARCHAR(23),
    `reject_status` INT(1) NOT NULL default 0,
    `reject_date` VARCHAR(23),
    `reject_reason` TEXT default "",
