    `mod_date` VARCHAR(23),
    `del_date` VARCHAR(23),
    `is_delete` INT(1),
    PRIMARY KEY(`item_id`, `item_no`),
    INDEX `title`(`title`(10), `title_english`(10)),
    INDEX `is_delete`(`is_delete`),
    KEY `item_type_id` (`item_type_id`)
) ENGINE=innodb ;

